import React, {Component} from "react";

import {Container, Nav, Navbar} from "react-bootstrap";

class Footer extends Component {
    render() {
        return (
            <div className="row">
                <div className="col-12 col-md text-center-movil">
                    <a href="https://mexrentacar.com/es/aviso-de-privacidad" className="link-footer">Aviso de
                        Privacidad</a>
                    <a href="https://mexrentacar.com/es/conoce-mex-rent-a-car" className="link-footer">Conoce Mex Rent a
                        Car</a>
                    <a href="https://mexrentacar.com/es/oficinas" className="link-footer">Nuestras Ubicaciones</a>
                    <a href="https://mexrentacar.com/es/booking/recuperar-mi-reserva-form" className="link-footer">Revisar
                        mi Reservación</a>
                </div>
                <div className="col-12 col-md text-center-movil">
                    <a href="https://mexrentacar.com/es/preguntas-frecuentes" className="link-footer">Preguntas
                        Frecuentes</a>
                    <a href="https://mexrentacar.com/es/contacta" className="link-footer">Contáctanos</a>
                    <a href="https://mexrentacar.com/es/terminos-y-condiciones" className="link-footer">Términos y
                        Condiciones</a>
                </div>
            </div>
            );
    }
}
